					zip.write(MAPPING_TEMPLATE.create(obj, modelId).getBytes());
					zip.closeEntry();
				}
			} catch (Exception ex) {
				ex.printStackTrace();
			} finally {
				if (zip != null) {
					zip.close();
				}
			}

			return baos.toByteArray();
